import React from "react";
import { useParams } from "react-router-dom";

import PlaceList from "../components/PlaceList";

const DUMMY_PLACES = [
  {
    id: "p1",
    title: "SVNIT- surat",
    description: "One of the reputed NIT's in surat",
    imageUrl:
      "https://qph.cf2.quoracdn.net/main-qimg-cf5f92d339653c7c7d224fcdc7d7fc3f.webp",
    address: "chchhanath Surat- Dumas, Road, Keval Chowk, Surat",
    location: {
      lat: 21.1640345,
      long: 72.7782708,
    },
    creator: "u1",
  },
  {
    id: "p2",
    title: "SVNIT- surat",
    description: "One of the reputed NIT's in surat",
    imageUrl:
      "https://www.google.com/url?sa=i&url=https%3A%2F%2Ftimesofindia.indiatimes.com%2Fcity%2Fsurat%2Fno-probe-ordered-into-alleged-financial-irregularities-at-svnit%2Farticleshow%2F68192065.cms&psig=AOvVaw3fWK_R83Wk2guXLEouW1n4&ust=1649422480818000&source=images&cd=vfe&ved=0CAoQjRxqFwoTCID0vNv_gfcCFQAAAAAdAAAAABAo",
    address: "chchhanath Surat- Dumas, Road, Keval Chowk, Surat",
    location: {
      lat: 21.1640345,
      long: 72.7782708,
    },
    creator: "u2",
  },
];

const UserPlaces = () => {
  const userId = useParams().userId;
  const loadedPlaces = DUMMY_PLACES.filter(
    (places) => places.creator == userId
  );
  return <PlaceList items={loadedPlaces} />;
};

export default UserPlaces;
